<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <title>Company Seating Chart</title>
  <link rel="stylesheet" href="style.css" />
  <style>
    /* Basic styles for layout */
    body {
      font-family: Arial, sans-serif;
      background: #f0f8ff;
      margin: 0;
      padding: 20px;
      display: flex;
      flex-direction: column;
      align-items: center;
    }
    h1 {
      color: #1e4e79;
      margin-bottom: 10px;
    }
    .chart-container {
      position: relative;
      width: 800px; /* Adjust to your SVG size */
      max-width: 100%;
    }
    /* Style for inline SVG if you embed SVG code directly */
    svg {
      width: 100%;
      height: auto;
      display: block;
    }
    /* Seat status styles for interactivity */
    .seat {
      cursor: pointer;
      transition: fill 0.3s ease;
    }
    .available {
      fill: #4caf50; /* green */
    }
    .used {
      fill: #f44336; /* red */
    }
    .reserved {
      fill: #ffeb3b; /* yellow */
    }
    /* Tooltip style */
    .tooltip {
      position: absolute;
      padding: 5px 8px;
      background: #333;
      color: #fff;
      border-radius: 4px;
      font-size: 12px;
      pointer-events: none;
      opacity: 0;
      transition: opacity 0.2s ease;
    }
   body.admin-mode {
    background-color: #e6f4ff; /* light blue */
  }

  button#toggle-mode {
    margin-bottom: 10px;
    padding: 6px 12px;
    background-color: #1e4e79;
    color: white;
    border: none;
    border-radius: 4px;
    cursor: pointer;
  } 
</style>
</head>
<body>

  <h1>Company Seating Chart</h1>

  <!-- Admin/User Mode Toggle -->
  <button id="toggle-mode">Switch to Admin Mode</button>
<!-- Export Data Button -->
  <button id="export-data">Export Data</button>
  <!-- Company Logo Background Banner -->
  <div class="logo-banner"></div>

  <!-- Legend / Key for Seat Status -->
  <div class="legend" style="margin: 10px 0; display: flex; gap: 15px;">
    <div><span style="display: inline-block; width: 16px; height: 16px; background: #4caf50; margin-right: 5px;"></span>Available</div>
    <div><span style="display: inline-block; width: 16px; height: 16px; background: #f44336; margin-right: 5px;"></span>Used</div>
    <div><span style="display: inline-block; width: 16px; height: 16px; background: #ffeb3b; margin-right: 5px; border: 1px solid #aaa;"></span>Reserved</div>
  </div>
